import React from 'react';

import { Link } from 'react-router-dom';

const Header = () => {
   
    return (
        <div className="container" key="header">
            <header>
                <Link to="/" className="btn btn-primary mt-5" key="homepage">
                    Homepage
                </Link>

                <Link to="/authors" key="authors">
                    Authors
                </Link>
            </header>

        </div>
    );
};

export default Header;
